import React, { useEffect, useState } from "react";
import achievementProps from "../Props/acgievementProps";

function Achievements() {

    const [achievementList, SetAchievementList] = useState('');

    useEffect(() => {
      let props = achievementProps();
      SetAchievementList(props.map(prop => 
        <div className={prop.className} name={prop.name}>{prop.name}</div>
        ));
    }

    )

    return (
        <div className="achievements">
           {achievementList}
        </div>
  );
}

export default Achievements
